/*Table structure for table `invoices` */

DROP TABLE IF EXISTS `invoices`;

CREATE TABLE `invoices` (
  `id` int(20) NOT NULL,
  `invoice` varchar(20) DEFAULT NULL,
  `customer_id` int(5) DEFAULT NULL,
  `courier` varchar(20) DEFAULT NULL,
  `service` varchar(20) DEFAULT NULL,
  `cost_courier` int(12) DEFAULT NULL,
  `wight` int(5) DEFAULT NULL,
  `name` varchar(20) DEFAULT NULL,
  `phone` int(5) DEFAULT NULL,
  `province` int(5) DEFAULT NULL,
  `city` int(5) DEFAULT NULL,
  `address` text DEFAULT NULL,
  `status` varchar(20) DEFAULT NULL,
  `grand_total` int(12) DEFAULT NULL,
  `snap_token` varchar(20) DEFAULT NULL,
  `create_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `invoices` */

/*Table structure for table `masterproduct` */

DROP TABLE IF EXISTS `masterproduct`;

CREATE TABLE `masterproduct` (
  `Code` varchar(50) NOT NULL,
  `Name` varchar(50) DEFAULT '',
  `Category` varchar(50) DEFAULT '',
  `SubCategory` varchar(50) DEFAULT '',
  `Type` varchar(50) DEFAULT '',
  `MinStock` int(11) DEFAULT 0,
  `MaxStock` int(11) DEFAULT 0,
  `MinOrder` int(11) DEFAULT 0,
  `StockProduct` tinyint(1) DEFAULT 1,
  `ActiveProduct` tinyint(1) DEFAULT 1,
  `BundledProduct` tinyint(1) DEFAULT 1,
  `canBuy` tinyint(1) DEFAULT 1,
  `canSell` tinyint(1) DEFAULT 1,
  `Supplier` varchar(50) DEFAULT '',
  `UOM` varchar(50) DEFAULT '',
  `ProductionUnit` varchar(50) DEFAULT '',
  `BuyPrice` int(12) DEFAULT 0,
  `SellPrice` int(12) DEFAULT 0,
  `Barcode` varchar(20) DEFAULT '',
  `HppBy` varchar(20) DEFAULT '',
  `AccHppNo` varchar(50) DEFAULT '',
  `AccPurchaseNo` varchar(50) DEFAULT '',
  `AccSellNo` varchar(50) DEFAULT '',
  `AccInventoryNo` varchar(50) DEFAULT NULL,
  `Department` varchar(50) DEFAULT '',
  `Memo` longtext DEFAULT NULL,
  `CreatedBy` varchar(50) DEFAULT '',
  `CreatedDate` datetime DEFAULT NULL,
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`Code`),
  KEY `Code` (`Code`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci ROW_FORMAT=COMPACT;

