/*Table structure for table `transinvoice` */

DROP TABLE IF EXISTS `transinvoice`;

CREATE TABLE `transinvoice` (
  `TransNo` varchar(50) NOT NULL,
  `TransDate` date DEFAULT NULL,
  `AccCode` varchar(50) DEFAULT NULL,
  `AccName` varchar(50) DEFAULT NULL,
  `OrderNo` varchar(50) DEFAULT NULL,
  `DONo` varchar(100) DEFAULT NULL,
  `PaymentType` varchar(50) DEFAULT '',
  `AccountNo` varchar(50) DEFAULT '',
  `DeliveryCode` varchar(20) DEFAULT '',
  `xDeliveryto` text DEFAULT NULL,
  `Warehouse` varchar(50) DEFAULT '',
  `Salesman` varchar(50) DEFAULT '',
  `DueDate` date DEFAULT NULL,
  `TaxAmount` decimal(12,2) DEFAULT 0.00,
  `FreightPercent` int(5) DEFAULT 0,
  `FreightAmount` int(12) DEFAULT 0,
  `DiscPercentH` int(5) DEFAULT 0,
  `DiscAmountH` decimal(12,2) DEFAULT 0.00,
  `Correction` decimal(12,2) DEFAULT 0.00,
  `Note` text DEFAULT NULL,
  `TaxNo` varchar(50) DEFAULT '',
  `ReffNo` varchar(50) DEFAULT '',
  `Status` int(5) DEFAULT 0,
  `Total` decimal(12,2) DEFAULT 0.00,
  `TotalPaid` decimal(12,2) DEFAULT 0.00,
  `FirstPaymentAmount` decimal(12,2) DEFAULT 0.00,
  `TotalReturn` decimal(12,2) DEFAULT 0.00,
  `CreatedBy` varchar(50) DEFAULT '',
  `CreatedDate` datetime DEFAULT NULL,
  `CreatedMachine` varchar(50) DEFAULT '',
  `Token` varchar(10) DEFAULT '',
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`TransNo`),
  KEY `TransNo` (`OrderNo`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1867 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

